<script>
"use strict";

<!-- https://plot.ly/javascript/contour-plots/ -->
<!-- https://plot.ly/javascript/graphing-multiple-chart-types/ -->

var ftext = "x^2 + 2.2 y^2 - 2 x*y";
var f = math.parse(ftext);



function graddesc_fixstep_trace(f, x0, n_steps, stepsize) {
    var cf = f.compile();
    var dfx = math.derivative(f, 'x').compile();
    var dfy = math.derivative(f, 'y').compile();

    var cur = x0;

    var xs = [];
    var ys = [];
    var zs = [];

    for (var step = 0; step < n_steps; ++step)
    {
        xs.push(cur.x);
        ys.push(cur.y);
        zs.push(cf.evaluate(cur));
        var dirx = - dfx.evaluate(cur);
        var diry = - dfy.evaluate(cur);
        cur.x += stepsize * dirx;
        cur.y += stepsize * diry;
    }
    return {
            name: 'steepest',
            type: 'scatter3d',
            mode: 'markers+lines',
            x: xs,
            y: ys,
            z: zs,
        };
}



function func_2d_eval(f, xs, ys) {
    var cf = f.compile();
    return ys.map(function (y) {
        return xs.map(function(x) {
            return cf.evaluate({x: x, y:y});
        });
    });
}

function func_2d_trace(f, xs, ys) {
    const zs = func_2d_eval(f, xs, ys);
    return {
            name: 'f',
            x: xs,
            y: ys,
            z: zs,
            autocontour: true,
            ncontours: 60,
            coloring: 'fill', // fill, lines, heatmap
        };
}

const xs = math.range(-3, 3, 0.05).toArray();
const ys = math.range(-2, 2, 0.05).toArray();

var data = [
    func_2d_trace(f, xs, ys),
    graddesc_fixstep_trace(f, {x: 0, y: -1.7}, 10, 0.3),
];

var layout = ploptly.getDefaultLayout2D();

var func_3d_contours_z = {

};

var options = ploptly.getDefaultOptions();
Plotly.newPlot(graphDiv, data, layout, options);
Plotly.restyle(graphDiv, restyle_contour);
